package Solace::Semp;

use strict;
use warnings;
use Data::Dumper;
use Carp;
use IO::Socket::INET;
use MIME::Base64;

my $schema;

# 
# Constructor
#
# Options:
#   hostname => <hostname>,
#   debug => <0|1>,
#   username => <SEMP username>,
#   password => <SEMP password>,
#
# Note it is acceptable to not specify the appliance, but
# the user should only use the conversion functions. 
sub new {
  my $class = shift;
  my %args = @_;

  my $self = {};

  $self->{debug}            = $args{debug}      || 0;
  $self->{indent}           = $args{indent}     || 0;
  $self->{username}         = $args{username};
  $self->{password}         = $args{password};
  $self->{hostname}         = $args{hostname};
  $self->{customTransport}  = $args{customTransport};
  $self->{port}             = $args{port}       || 80;
  $self->{version}          = $args{version} || $schema->{version};
 
  if (!defined $self->{username}) {
    $self->{username} = "admin";
  }
  if (!defined $self->{password}) {
    $self->{password} = "admin";
  }

  ($self->{name}, $self->{ip}) = getHostnameAndIp($self->{hostname}) if $self->{hostname};

  bless($self, $class);

  return $self;

}

sub _debug {
  my ($self, @params) = @_;
  return if !$self->{debug};
  foreach my $param (@params) {
    my $type = ref($param);
    if ($type eq "") {
      print $param;
    }
    elsif ($type eq "ARRAY") {
      print " @{$param}";
    }
    else {
      print "$param";
      #print Dumper $param;
    }
    print " ";
  }
  print "\n";
}

sub cliToSemp {
  my $xml;
  eval {
    $xml = _cliToSemp(@_);
  };
  if ($@) {
    print "$@\n";
    return undef;
  }
  return $xml;
}

# Send a SEMP request to the appliance
# This can take pure XML or a CLI string
sub send {
  my ($self, %args) = @_;

  my $xml;
  if ($args{cli}) {
    $xml = $self->cliToSemp(cli => $args{cli});
    croak("Failed to convert CLI string $args{cli} to SEMP XML") if !defined($xml);
  }
  elsif ($args{xml}) {
    $xml = $args{xml};
  }
  else {
    croak("You must provide 'cli' or 'xml' parameters to 'send'");
  }

  if (!defined($self->{ip})) {
    croak("You must create a SEMP object with a specified hostname in order to call 'send'");
  }

  my $xmlResp;

  if ($self->{customTransport}) {
    $xmlResp = &{$self->{customTransport}}($xml);
  }
  else {
    $xmlResp = $self->_sendAndReceiveSemp($xml);
  }


  my $obj = xmlToObj($xmlResp);
  $obj->{xml} = $xmlResp;
  return $obj;

}


sub _sendAndReceiveSemp {
  my ($self, $xml) = @_;
  
  my $sock = IO::Socket::INET->new(PeerAddr => $self->{ip},
                                   PeerPort => $self->{port},
                                   Reuse => 1,
                                   Proto => 'tcp');
  
  croak("Failed to create socket to $self->{name} ($self->{ip}) port $self->{port}: $!") if !defined($sock);

  my $auth = encode_base64("$self->{username}:$self->{password}");
  $auth =~ s/[\n\r]//g;
  my $http = ("POST /SEMP HTTP/1.0\r\n".
              "Content-Length: ". length($xml) ."\r\n".
              "Authorization: Basic $auth\r\n".
              "\r\n$xml");

  syswrite($sock, $http);

  my $resp;
  my $count; 
  my $state = 0;
  my $len;

  while (1) {
    my $buf;
    $count = sysread($sock, $buf, 2048);
    $resp .= $buf;
    if ($state == 0) {
      if ($resp =~ /HTTP\/\d\.\d (\d+) (.*?)\r\n/) {
        if ($1 == "200") {
          $state = 1;
        }
        else {
          croak("Communication error with appliance: HTTP error: $1 $2");
        }
      }
    }
    if ($state == 1) {
      if ($resp =~ /Content-Length:\s*(\d+)\s*\r\n/) {
        $state = 2;
        $len = $1;
      }
    }
    if ($state == 2) {
      if ($resp =~ /\r\n\r\n/g) {
        $state = 3;
        $resp = substr($resp, pos($resp));
      }
    }
    if ($state == 3) {
      if (length($resp) >= $len) {
        last;
      }
    }

    if ($count <= 0) {
      last;
    }
  }

  return $resp;

}

sub _cliToSemp {
  my ($self, %options) = @_;

  $options{cli} =~ s/^(enable)?(\s*config(ure)?)?//;
  $options{cli} =~ s/(^\s+)|(\s*$)//g;

  my $params = [split(/\s+/, $options{cli})];
  my $obj = {name => "rpc",
             children => [],
             attributes => {'semp-version' => "soltr/" . $self->{version}}};
  my $node = $schema->{data};
  
  sub handleNode {
    my ($self, $node, $obj, $depth, $params, $optional) = @_;

    $self->_debug("Params: ", Dumper($params));
    $self->_debug("Handling node: ", Dumper($node));
    my $param = $params->[0];
    if (defined($node->{n})) {
      if (scalar(@{$params}) == 0) { return {satisfied => $node->{op}}; }
      my @text;
      my $rc = {};
      if (defined($node->{dt}) && $node->{dt} ne 'keywordType' &&
          $node->{dt} ne 'suppressedKeywordType') { # Non-keyword
        if ($node->{l}) {
          # This is a list, which will consume the remaining parameters
          my @restore;
          while(@{$params}) {
            $rc = validateParam($schema->{types}, $node->{dt}, $node->{n}, $param, $optional);
            #push(@restore, shift(@{$params}));
            push(@text, $param);
            shift(@{$params});
            $param = $params->[0];
          }
        }
        else {
          $rc = validateParam($schema->{types}, $node->{dt}, $node->{n}, $param, $optional);
          push(@text, $param);
        }
        return {} if !defined($rc);
      }
      elsif ($param ne $node->{n}) { # Keyword, but doesn't match
        $self->_debug("non-matching keyword: $param ne $node->{n}");
        return {};
      }

      shift(@{$params});
      $self->_debug("Consumed parameter => ", $param, "Left => ", $params);
      my $entry;
      if (defined($node->{dt}) && $node->{dt} eq 'suppressedKeywordType') {
        $entry = $obj;
      }
      else {
        my $lastEntry;
        push(@text, "") if !@text;
        foreach my $text (@text) {
          $entry = {name => $node->{n}, text => $text, children => []};
          push(@{$obj}, $entry);
          $lastEntry = $entry;
        }
        $entry = $lastEntry->{children};
      }
      if ($node->{s} || $node->{c}) {
        my $rc = $self->walker($node, $entry, $depth+1, $params);
        return $rc;
      }
      return {satisfied => 1};
    }
    else {
      return $self->walker($node, $obj, $depth+1, $params);
    }
  };

  sub walker {
    my ($self, $node, $obj, $depth, $params)  = @_;

    $self->_debug("Walker => ", $depth, $node, $obj, $params);
    if ($node->{c}) {
      $self->_debug("Found choice node");
      # It is a choice node, which means we must pick
      # 0 (if optional) or 1 entry
      my ($i, $rc, $satisfied);
      my $nParams = scalar(@{$params});
      for ($i = 0; $i < scalar(@{$node->{c}}); $i++) {
        $rc = $self->handleNode($node->{c}[$i], $obj, $depth, $params);
        $self->_debug("on way up: " . $depth, $node, $rc);
        $satisfied = $satisfied || $rc->{satisfied};
        if ($satisfied && $nParams > scalar(@{$params})) {
          last;
        }
      }
      if (!$satisfied && !$node->{op}) {
        return {satisfied => 0};
        # Failed to choose an option within a non-optional choice
        if (scalar(@{$params}) == 0) {
          croak("Missing one or more parameters");
        }
        croak("Bad parameter: " . $params->[0]);
      }
      return {satisfied => 1};
    }
    elsif ($node->{s}) {
      my ($i, $rc);
      for ($i = 0; $i < scalar(@{$node->{s}}); $i++) {
        $rc = $self->handleNode($node->{s}[$i], $obj, $depth, $params, $node->{s}[$i]{op});
        $self->_debug("sequenced node ", $i, " returned: ", $rc, ", depth: ", $depth);
        if (!$rc->{satisfied}) {
          if ($node->{s}[$i]{op}) {
            # just skip it
          }
          elsif ($node->{op}) {
            return {satisfied => 1};
          }
          else {
            $self->_debug("Bad parameter", $depth, $node, $i, $params);
            return {satisfied => 0};
            croak("Bad parameter: " . $params->[0]);
          }
        }
      }
      return {satisfied => 1};
    }
    elsif ($node->{n}) {
      # Do nothing
      $self->_debug("Unexpected node without a .c or .s", $node);
      return {};
    }
    $self->_debug("Unexpected situation", $node);
  };

  my $rc = $self->walker($node, $obj->{children}, 1, $params);

  $self->_debug("Done: ", $obj);

  if (scalar(@{$params})) {
    croak("Unexpected parameter(s): " . join(" ", @{$params}));
  }

  my $xml = $self->objToXml($obj, "");
  $self->_debug("XML: " . $xml);
  return $xml;

};

sub escapeXml {
    my ($text) = @_;

    my %repl = (
          '>' => '&gt;',
          '<' => '&lt;',
          '>' => '&gt;',
          '&' => '&amp;',
          '\''=> '&apos;',
          '"' => '&quot;',
          );
    $text =~ s/([&<>'"])/$repl{$1}/eg;

    return $text;
}

sub objToXml {
  my ($self, $obj, $depth) = @_;
  $depth ||= 0;
  my $xml = "";
  $xml .= (" " x ($self->{indent} * $depth)) if $self->{indent};
  $xml .= "<" . $obj->{name};
  if ($obj->{attributes}) {
    foreach my $name (keys(%{$obj->{attributes}})) {
      $xml .= " " . $name . "=\"" . $obj->{attributes}{$name} . "\"";
    };
  }
  $xml .= ">";
  if ($obj->{text}) {
    $xml .= escapeXml($obj->{text});
  }
  if (scalar(@{$obj->{children}})) {
    $xml .= "\n" if $self->{indent};
    foreach my $child (@{$obj->{children}}) {
      $xml .= $self->objToXml($child, $depth+1);
    };
    $xml .= (" " x ($self->{indent} * $depth)) if $self->{indent};
  }
  $xml .= "</" . $obj->{name} . ">";
  $xml .= "\n" if $self->{indent};
  return $xml;
}

sub validateParam {
  my ($types, $dt, $name, $param, $dontDieOnError) = @_;
  my $type;
  if (!defined($types->{$dt})) {
    if ($dt eq "suppressedKeywordType") {
      return {suppressedKeyword => 1};
    }
    elsif ($dt =~ /^xs/) {
      $type = {t => $dt};
    }
    else {
      $dontDieOnError ? return undef : croak("Unknown datatype: " . $dt);
    }
  }
  else {
    $type = $types->{$dt};
  }
  
  if (!defined($type->{t})) {
    print "PROBLEM with t\n";
    print Dumper $type;
    print Dumper $types;
    print "$dt, $name, $param\n";
  }
  if ($type->{t} eq "xs:string") {
    if ($type->{minLength}) {
      if (length($param) < $type->{minLength}) {
        $dontDieOnError ? return undef : croak("Parameter " . $param . " is too short. Min length is " . $type->{minLength});
      }
    }
    if ($type->{maxLength}) {
      if (length($param) > $type->{maxLength}) {
        $dontDieOnError ? return undef : croak("Parameter " . $param . " is too long. Max length is " . $type->{maxLength});
      }
    }
    if ($type->{enumeration}) {
      my $found = 0;
      for (my $i = 0; $i < scalar(@{$type->{enumeration}}); $i++) {
        if ($param eq $type->{enumeration}[$i]) {
          $found = 1;
          last;
        }
      }
      if (!$found) {
        $dontDieOnError ? return undef : croak("Invalid parameter: '" . $param . "'. Valid values are: " . join(" ", @{$type->{enumeration}}));
      }
    }
    if ($type->{pattern}) {
      if ($param !~ /$type->{pattern}/) {
        $dontDieOnError ? return undef : croak("Invalid parameter: '" . $param . "'. It must match the pattern: " . $type->{pattern});
      }
    }
  }
  
  if ($type->{t} eq "xs:int" || $type->{t} eq "xs:unsignedInt" || $type->{t} eq "xs:unsignedLong") {
    my $val = $param;
    if ($val !~ /^\d+$/) {
      $dontDieOnError ? return undef : croak("Parameter '" . $param . "' is supposed to be an integer");
    }
    if ($type->{minInclusive}) {
      if ($val < $type->{minInclusive}) {
        $dontDieOnError ? return undef : croak("Parameter " . $param . " is too small. Min value is " . $type->{minInclusive});
      }
    }
    if ($type->{maxInclusive}) {
      if ($val > $type->{maxInclusive}) {
        $dontDieOnError ? return undef : croak("Parameter " . $param . " is too large. Max value is " . $type->{maxInclusive});
      }
    }
  }
  
  return {};
}


sub xmlToObj {
  my ($xml) = @_;
  my $res = {};
  parseXmlRec($res, \$xml, 0) || return undef;
  bless($res, 'Solace::Semp::Response');
  return $res;
  
} # ParseXml #


sub parseXmlRec {
  my ($res, $xml_p, $depth) = @_;

  if ($depth++ > 100) {
    carp("Recursion too deep while parsing XML");
    return undef;
  }

  my $guard = 1000;
  while (($$xml_p ne "") && (--$guard > 0)) {
   if ($$xml_p =~ s/^[\s\n]*<([\w\d_\-]+)([^>]*)>//) {
      my ($element, $attribs) = ($1, $2);
      if (defined $element && $element ne "") {
        my $node;
        if (ref $res->{$element} eq "ARRAY") {
          $node = {};
          push(@{$res->{$element}}, $node);
        }
        elsif (exists($res->{$element})) {
          $res->{$element} = [$res->{$element}];
          $node = {};
          push(@{$res->{$element}}, $node);
        }
        else {
          $res->{$element} = {};
          $node = $res->{$element};
        }
        if (defined($attribs)) {
          my %attribs = ($attribs =~ /([\w\d_\_]+)\s*=\s*['"]([^'"]*)['"]/g);
          foreach my $attr (keys(%attribs)) {
            $node->{$attr} = $attribs{$attr};
          }
        }

        parseXmlRec($node, $xml_p, $depth) || return undef;

        my ($close) = ($$xml_p =~ s/^[\s\n]*<\/($element)\s*>//);
        
        if (!defined $close) {
          PeriodicLog("ERROR", "Failed to parse XML: $$xml_p");
          return undef
        }
      }
    }
    elsif ($$xml_p =~ /^\s*<\//) {
     last;
    }
    elsif ($$xml_p =~ s/^[\s\n]*<!--([^>]*?)-->//) {
      # Do nothing for comments
    }
    else {
      $$xml_p =~ s/([^<>]+)//;
      my ($content) = $1;
      # print "got content: $content\n";
      if (defined $content && $content !~ /^\s*$/) {
        $res->{Content} = replaceEntities($content);
      }
    }

  }

  if ($guard <= 0) {
      carp("Infinite loop in parseXmlRec");
      return undef;
  }

  return 1;

}


sub getHostnameAndIp {
  my ($name) = @_;

  my (@bytes, @octets,
    $packedaddr,
    $raw_addr,
    $host_name,
    $ip
  );

  if($name =~ /sm:\d+/) {
    $ip = "127.0.0.1";
    $host_name = $name;
  }
  elsif($name =~ /[a-zA-Z]/g) {
    $raw_addr = (gethostbyname($name))[4];
    @octets = unpack("C4", $raw_addr);
    $host_name = $name;
    $ip = join(".", @octets);
  } 
  else {
    @bytes = split(/\./, $name);
    map {if ($_ > 255) { Fatal("Invalid IP address: $name")}} @bytes;
    $packedaddr = pack("C4",@bytes);
    $ip = $name;
    $host_name = (gethostbyaddr($packedaddr, 2))[0];
  }

  return($host_name, $ip);

}

sub replaceEntities {
    my ($text) = @_;
    my %trans = (
      gt => '>',
      lt => '<',
      amp => '&'
    );
    $text =~ s/&(.*);/$trans{$1}||""/eg;
    return $text;
}


## Package to give special handling to responses
package Solace::Semp::Response;

use Scalar::Util          qw/reftype blessed/;

my $xpathAvail = eval {
  require XML::XPath;
  XML::XPath->import();
  1;
};

sub convertToString {
  my ($self) = @_;
  my $firstContent = $self->getFirstContent();
  return "$firstContent";
}

sub convertToNumber {
  my ($self) = @_;
  my $firstContent = $self->getFirstContent();
  return $firstContent + 0;
}

sub convertToBool {
  my ($self) = @_;
  my $firstContent = $self->getFirstContent();
  return $firstContent ? 1 : 0;
}

