sub getFirstContent {
  my ($self) = @_;
  return $self->getFirstContentRec($self);
} 

sub getFirstContentRec {
  my ($self, $node) = @_;

  my $ref = reftype($node) || "";
  if ($ref eq "ARRAY") {
    foreach my $entry (@$node) {
      return $self->getFirstContentRec($entry);
    }
  }
  elsif ($ref eq "HASH") {
    foreach my $key (keys(%$node)) {
      my $keyRef = reftype($node->{$key});
      if ($keyRef eq "HASH" && $node->{$key}{Content}) {
        return $node->{$key}{Content};
      }
      else {
        my $res = $self->getFirstContentRec($node->{$key});
        return $res if $res;
      }
    }
  }
  else {
    return $node;
  }
  return undef;
} 


sub find {
  my ($self, $criterion) = @_;
  my $res = [];
  $self->findRec($res, $self, $criterion);
  bless($res, "Solace::Semp::Response");
  return $res;
}

sub findXpath {
  my ($self, $xpath) = @_;
  if ($xpathAvail) {
    if (!defined($self->{xp})) {
      $self->{xp} = XML::XPath->new(xml => $self->{xml});
    }
    return $self->{xp}->findvalue($xpath). "";
  }
  else {
    croak("XML::XPath not available on your system - please install");
  }
}

sub findRec {
  my ($self, $res, $node, $criterion) = @_;

  my $ref = reftype($node) || "";
  if ($ref eq "ARRAY") {
    foreach my $entry (@$node) {
      $self->findRec($res, $entry, $criterion);
    }
  }
  elsif ($ref eq "HASH") {
    foreach my $key (keys(%$node)) {
      if ($key eq $criterion) {
        my $keyRef = reftype($node->{$key}) || "";
        if ($keyRef eq "HASH" &&
            $node->{$key}{Content}) {
          my $obj = $node->{$key};
          bless($obj, "Solace::Semp::Response");
          push(@$res, $node->{$key}{Content});
        }
        else {
          my $obj = $node->{$key};
          bless($obj, "Solace::Semp::Response");
          push(@$res, $node->{$key});
        }
      }
      else {
        $self->findRec($res, $node->{$key}, $criterion);
      }
    }
  }

